import React, { Component } from 'react';
import dynamic from 'next/dynamic';

const INFO_MESSAGES =
  '안녕하세요.웹 개발자 윤인배 입니다.React와 Django를 좋아합니다.';

const Typewriter = dynamic(() => import('typewriter-effect'), {
  ssr: false
});

const PrintMessages = () => {
  const messages = INFO_MESSAGES.split('.');
  let jsxArray = [];
  for (let m = 0; m < messages.length - 1; m++) {
    messages[m] += '.';
    console.log(messages[m]);
  }
  return <Typewriter strings={messages} />;
};
PrintMessages();
class Index extends Component {
  render() {
    return (
      <Typewriter
        options={{
          strings: ['Hello', 'World'],
          autoStart: true,
          loop: true
        }}
      />
    );
  }
}

export default Index;
